	(19378, '혈족군주의 망토', 'Cape du seigneur des couvées', 'Umhang des Brutlords', '龙王披风', '龍王披風', 'Capa del Señor del linaje', 'Capa del Señor del linaje', 'Плащ Мрачного лорда', '처음 보는 종류의 실로 만들어져 있습니다. 원재료는 금속인 것 같습니다.', 'Le tissage ne ressemble à rien de ce que vous connaissez. Les fils semblent d\'origine métallique.', 'Der Stoff ist anders, als alles was ihr je gesehen habt. Er scheint metallischen Ursprungs zu sein.', '你从未见过这样的丝线，它仿佛是由金属制成的。', '你從未見過這樣的絲線，它彷彿是由金屬製成的。', 'Los hilos no se parecen a nada que hayas visto antes. Parecen metálicos.', 'Los hilos no se parecen a nada que hayas visto antes. Parecen metálicos.', 'Такой ткани вы еще никогда не видели. Кажется, что плащ сделан из металла.'),
	(19379, '넬타리온의 눈물', 'Larme de Neltharion', 'Neltharions Träne', '奈萨里奥之泪', '奈薩里奧之淚', 'Lágrima de Neltharion', 'Lágrima de Neltharion', 'Слеза Нелтариона', '은색 액체가 깨지지 않는 검은 껍질 속에 흐르고 있습니다. 주위로 극한의 힘의 정기가 뿜어져 나옵니다.', 'Un liquide argenté coule sous le revêtement d\'ébène impénétrable. L\'objet donne une sensation de pureté. C\'est comme si l\'essence d\'un pouvoir extrême l\'irradiait.', 'Die dunkle Schale enthält eine silberne Flüssigkeit. Bei ihrem Anblick empfindet Ihr ein Gefühl vollkommener Reinheit und Macht.', '银色的液体在乌黑的外壳中涌动，这件物品非常纯净，它散发着强大的能量。', '銀色的液體在烏黑的外殼中湧動，這件物品非常純淨，它散發著強大的能量。', 'Un líquido plateado fluye dentro del impenetrable caparazón de ébano. El objeto parece puro. Irradia pureza. Irradia una esencia de gran poder.', 'Un líquido plateado fluye dentro del impenetrable caparazón de ébano. El objeto parece puro. Irradia pureza. Irradia una esencia de gran poder.', 'Серебряная жидкость струится из непроницаемо черной раковины. Этот предмет источает ощущение чрезвычайной силы.'),
	(19380, '테라제인의 사슬', 'Chaîne de Therazane', 'Therazanes Zusammenhalt', '塞拉赞恩之链', '瑟拉贊恩之鍊', 'Eslabón de Therazane', 'Eslabón de Therazane', 'Цепочка Теразана', '손을 대면 따뜻한 느낌이 납니다. 허리띠와 연결된 사슬은 엘레멘티움으로 만들어진 것 같습니다.', 'Le métal est chaud au toucher. Les maillons formant la ceinture semblent faits d\'élémentium.', 'Das Metall fühlt sich warm an. Es scheint als wären die Bindeglieder des Gürtels aus Elementium gefertigt.', '金属摸上去热乎乎的，连接腰带的材料似乎是源质。', '金屬摸上去熱呼呼的，連接腰帶的材料似乎是源質。', 'El metal está caliente al tacto. Las uniones de la cinta parecen estar hechas de elementium.', 'El metal está caliente al tacto. Las uniones de la cinta parecen estar hechas de elementium.', 'Металл теплый на ощупь. Звенья, соединяющие пояс, кажется, выполнены из Элементия.'),
