	(19390, '튼튼한 용가죽 장갑', 'Gants en cuir de dragon tendu', 'Gehärtete Drachenlederhandschuhe', '紧绷的龙皮手套', '緊繃的龍皮手套', 'Guantes de pellejo de dragón tirante', 'Guantes de pellejo de dragón tirante', 'Тугие перчатки из драконьей шкуры', '장갑을 끼자 등골에 서늘한 기운이 감돕니다. 이 장갑 하나를 만들기까지 많은 새끼용들이 죽음을 당했습니다.', 'Un frisson glacial vous traverse l\'échine alors que vous posez la main sur ces gants. Ils semblent faits de la peau de dragonnets… de nombreux dragonnets.', 'Euch läuft ein kalter Schauer über den Rücken. Es scheint als wären die Handschuhe aus der Haut von Drachenwelpen gefertigt.', '当你把手放在这双手套上时，你感觉到了一丝寒意。它们似乎是用幼龙的皮制成的——许多幼龙的皮。', '當你把手放在這雙手套上時，你感覺到了一絲寒意。它們似乎是用幼龍的皮製成的─許多幼龍的皮。', 'Cuando tocas estos guantes un escalofrío te recorre la espalda. Parecen estar hechos de piel de vástagos. De un montón de ellos.', 'Cuando tocas estos guantes un escalofrío te recorre la espalda. Parecen estar hechos de piel de vástagos. De un montón de ellos.', 'У тебя мурашки бегут по спине, когда ты всовываешь руки в эти перчатки. Они изготовлены из шкуры драконят. Множества драконят.'),
