	(22046, '군주 발타라크의 아뮬렛 오른쪽 조각', 'Morceau droit de l\'amulette du seigneur Valthalak', 'Rechtes Stück von Lord Valthalaks Amulett', '瓦塔拉克饰品的右半边', '瓦薩拉克領主護符的右半塊', 'Parte derecha del amuleto Lord Valthalak', 'Parte derecha del amuleto Lord Valthalak', 'Правая часть амулета Лорда Вальтхалака', '다른 아뮬렛 조각과 합쳐지려는 열망으로 강하게 진동하고 있습니다.', 'Cette partie de l\'amulette vibre, comme si elle s\'efforçait de rejoindre les autres morceaux.', 'Dieses Stück vibriert von einem fühlbaren Eifer beseelt, mit den anderen Stücken vereint zu werden.', '这件物品似乎很热切地想要和其它几块重新结合。', '這部份的護符以明確的熱情震動著，欲與護符其他部分重新結合。', 'Esta parte del amuleto palpita con anhelo palpable por reunirse con sus piezas hermanas.', 'Esta parte del amuleto palpita con anhelo palpable por reunirse con sus piezas hermanas.', 'Часть амулета явственно вибрирует, желая воссоединиться с остальными'),
	(22047, '군주 발타라크의 아뮬렛 가운데 조각', 'Morceau supérieur de l\'amulette du seigneur Valthalak', 'Obere Stück von Lord Valthalaks Amulett', '瓦塔拉克饰品的上半边', '瓦薩拉克領主護符的上半塊', 'Parte superior del amuleto de Lord Valthalak', 'Parte superior del amuleto de Lord Valthalak', 'Верхняя часть амулета Лорда Вальтхалака', '손 대면 마치 갇혀 있던 악마가 뛰쳐나올 것 같습니다.', 'Cet objet vous donne des frissons quand vous le touchez, comme si une chose maléfique tentait de s\'en échapper.', 'Dieses Stück fühlt sich seltsam an, als ob etwas Böses darin zu flüchten versucht.', '触摸这件物品时会有很奇怪的感觉，仿佛有什么邪恶的力量想要挣脱出来。', '這個物品摸起來怪怪的，好像裡面的惡魔正試圖逃走。', 'Al tocar este objeto siento algo maligno. Es como si su maldad intentase huir.', 'Al tocar este objeto siento algo maligno. Es como si su maldad intentase huir.', 'При прикосновении к этой вещи появляется неприятное ощущение, как будто заключенное в ней зло стремится вырваться наружу.'),
	(22048, '군주 발타라크의 아뮬렛', 'Amulette du seigneur Valthalak', 'Lord Valthalaks Amulett', '瓦塔拉克饰品', '瓦薩拉克領主的護符', 'Amuleto de Lord Valthalak', 'Amuleto de Lord Valthalak', 'Амулет Лорда Вальтхалака', '모든 조각이 재결합되었습니다. 아뮬렛은 군주 발타라크의 악령으로 강하게 진동하고 있습니다.', 'Ayant retrouvé sa forme première, l\'amulette irradie l\'aura maléfique du seigneur Valthalak.', 'Wieder zu einem Ganzen zusammengefügt, pulsiert in ihm die teuflische Seele von Lord Valthalak.', '这件重新结合起来的饰品散发出强大的邪恶力量，瓦塔拉克公爵的灵魂在其中蠢蠢欲动。', '重新組合成完整的形狀，護符隨著瓦薩拉克領主邪惡的靈魂脈動。', 'Recuperada su forma original, el amuleto vibra con la fuerza maligna de Lord Valthalak.', 'Recuperada su forma original, el amuleto vibra con la fuerza maligna de Lord Valthalak.', 'Собранный воедино, амулет пульсирует от силы Лорда Вальтхалака.'),
